import logo from './logo.svg';
import classes from './App.module.css';

function App() {
  return (
    <div className="App">
      <h1 className={classes.heading}>My favourite foods</h1>
        <div>
            <img src="https://i.ytimg.com/vi/xWZeQBLV6q4/maxresdefault.jpg" alt="Noodles"/>
        </div>
    </div>
  );
}

export default App;
